import React, { Component } from 'react';
import { Card, CardTitle, CardText } from 'reactstrap';
import './Compare.css';

class Compare extends Component {
  render(){

    const { searchListItems, data, item1, cal1, cal2, vitE1, vitE2, item2, fat1, fat2, sugar1, sugar2, item1Card, item2Card } = this.props;

    return (
      <main className='body' style={{display: 'flex'}}>
        <Card body className="text-center display" style={{ width: '350px', height: '300px'}}>
            <h2>{item1.name}</h2>
            <p>calories: {cal1}</p>
            <p>fat: {fat1}grams</p>
            <p>vitamin E: {vitE1}</p>
            <p>sugar: {sugar1}g</p>
        </Card>
          <div className="display" style={{ width: '350px', height: '300px'}}>
            <h2>{item2.name}</h2>
            <p>calories: {cal2}</p>
            <p>fat: {fat2}grams</p>
            <p>vitamin E: {vitE2}</p>
            <p>sugar: {sugar2}g</p>
          </div>
      </main>
    )
  }
}

export default Compare;

